import { Component, OnInit } from "@angular/core";
import { Workbook } from "exceljs";
import { ConfirmationService, MessageService, SelectItem } from "primeng/api";
import { Training_Attendance_report } from "src/app/_helper/SM_CODE";
import { CommonService } from "src/app/_services/common.service";
import { TransactionsService } from "../../transactions/transactions.service";
import { DatePipe } from "@angular/common";
import * as fs from "file-saver";
import { ReportsService } from "../reports.service";

@Component({
  selector: "app-attendance-report",
  templateUrl: "./attendance-report.component.html",
  styleUrls: ["./attendance-report.component.css"],
})
export class AttendanceReportComponent implements OnInit {
  public empList: any[] = [];
  public saveEmpFeedback: any[] = [];

  public EMP_ID: number;
  public selectedAppovalList: any[] = [];
  public selectedTraining: string;
  public trainingMasterDropdown: SelectItem[] = [];
  public effectivenessDropdown: SelectItem[] = [];
  public menuAccess: boolean = true;
  public addAccess: boolean = true;
  public viewAccess: boolean = true;
  public updateAccess: boolean = true;
  public deleteAccess: boolean = true;
  public printAccess: boolean = true;
  public backDateAccess: boolean = true;
  public pipe = new DatePipe("en-US");
  public totalRecords = 0;
  public TRAINING_MASTER_QUERY = {
    TableNames: "trainingprogrammaster,trainingprogram_master",
    fieldNames:
      "TrainingProgram_ID,TrainingProgramMaster_title +' -> '+ CONVERT(varchar,TRAININGPROGRAM_ID_FROM_DATE,107) +' - '+ CONVERT(varchar,TRAININGPROGRAM_ID_TO_DATE,107) as TrainingProgramMaster_title",
    condition:
      "TrainingProgramMaster_ID=trainingprogram_training_program_id and trainingprogram_master.ES_DELETE=0",
  };
  constructor(
    private commonService: CommonService,

    private service: ReportsService,
    private confirmationService: ConfirmationService,
    private messageService: MessageService
  ) {}

  ngOnInit(): void {
    var currentUser = JSON.parse(sessionStorage.getItem("currentUser"));

    var UM_CODE = currentUser?.user.UM_CODE;
    this.EMP_ID = currentUser?.user.EMP_CODE;
    this.commonService
      .checkRight(UM_CODE, Training_Attendance_report, "checkRight")
      .subscribe((data) => {
        for (let access of data) {
          this.menuAccess = true;
          this.addAccess = access.ADD;
          this.deleteAccess = access.DELETE;
          this.viewAccess = access.VIEW;
          this.printAccess = access.PRINT;
          this.backDateAccess = access.BACK_DATE;
          this.updateAccess = access.UPDATE;
        }
      });

    if (this.menuAccess) {
      this.effectivenessDropdown = [
        {
          label: "Effective",
          value: "effective",
        },
        {
          label: "Non-Effective",
          value: "non-effective",
        },
      ];
      this.commonService
        .FillCombo(this.TRAINING_MASTER_QUERY)
        .subscribe((data) => {
          for (let item of data) {
            console.log(data);
            this.trainingMasterDropdown.push({
              label: item.TrainingProgramMaster_title,
              value: item.TrainingProgram_ID,
            });
          }
        });
    }
  }
  onTrainingProgramChange() {
    console.log(this.selectedTraining);
    if (this.selectedTraining != null) {
      this.empList = [];
      this.service
        .getTrainingAttendance(this.selectedTraining)
        .subscribe((data) => {
          console.log(data);
          this.empList = data;
          this.totalRecords = this.empList.length;
          if (!this.empList.length) {
            this.messageService.add({
              key: "t1",
              severity: "error",
              summary: "Error",
              detail: "No Employee Found",
            });
          }
        });
    }
  }

  exportExcel() {
    var exportExcelColumns = [
      "SR NO",
      "EMPLOYEE NUMBER",
      "NAME OF EMPLOYEE",
      "DEPARTMENT",
      "SIGNATURE",
    ];
    if (this.empList.length == 0) {
      return this.messageService.add({
        key: "t1",
        severity: "error",
        summary: "Error",
        detail: "No Data Selected to export",
      });
    }

    let workbook = new Workbook();
    let worksheet = workbook.addWorksheet("Training_attendance");

    worksheet.mergeCells("B2:C5");
    worksheet.properties.defaultRowHeight = 35;

    worksheet.getCell("C5").alignment = {
      vertical: "middle",
      horizontal: "center",
    };
    worksheet.getCell("C5").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    const myBase64Image =
      "data:image/jpeg;base64,";
    const imageId2 = workbook.addImage({
      base64: myBase64Image,
      extension: "png",
    });

    worksheet.addImage(imageId2, "C2:C4");
    worksheet.properties.defaultRowHeight = 35;

    worksheet.mergeCells("D2:E5");

    // ... merged cells are linked
    worksheet.getCell("E5").value = "TRAINING PROGRAMME ATTENDANCE SHEET";

    worksheet.getCell("E5").alignment = {
      vertical: "middle",
      horizontal: "center",
    };

    worksheet.getCell("E5").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    worksheet.getCell("E5").font = {
      size: 20,
      underline: true,
      bold: true,
    };

    worksheet.mergeCells("F2:F3");

    worksheet.getCell("F2").value = "Date : " + this.empList[0].Date;

    worksheet.getCell("F2").alignment = {
      vertical: "middle",
      horizontal: "center",
    };

    worksheet.getCell("F2").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    worksheet.getCell("F2").font = {
      size: 12,
    };

    worksheet.mergeCells("F4:F5");

    worksheet.getCell("F4").value = this.empList[0].Time
      ? "Time:" + this.empList[0].Time
      : "Time:" + "";

    worksheet.getCell("F4").alignment = {
      vertical: "middle",
      horizontal: "center",
    };

    worksheet.getCell("F4").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    worksheet.getCell("F4").font = {
      size: 12,
    };

    worksheet.mergeCells("B6:C6");

    worksheet.getCell("B6").value = "Training Topic";

    worksheet.getCell("B6").alignment = {
      vertical: "middle",
      horizontal: "center",
    };

    worksheet.getCell("B6").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    worksheet.getCell("B6").font = {
      size: 14,

      bold: true,
    };

    worksheet.mergeCells("D6:F6");

    worksheet.getCell("D6").value = this.empList[0].Trainingtopic;
    worksheet.getCell("D6").alignment = {
      vertical: "middle",
      horizontal: "left",
    };

    worksheet.getCell("D6").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    worksheet.getCell("D6").font = {
      size: 14,
    };

    worksheet.mergeCells("B7:C7");

    worksheet.getCell("B7").value = "Faculty";

    worksheet.getCell("B7").alignment = {
      vertical: "middle",
      horizontal: "center",
    };

    worksheet.getCell("B7").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    worksheet.getCell("B7").font = {
      size: 14,

      bold: true,
    };

    worksheet.mergeCells("D7:F7");

    worksheet.getCell("D7").value = this.empList[0].Faculty;
    worksheet.getCell("D7").alignment = {
      vertical: "middle",
      horizontal: "left",
    };

    worksheet.getCell("D7").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    worksheet.getCell("D7").font = {
      size: 14,
    };

    worksheet.mergeCells("B8:C8");

    worksheet.getCell("B8").value = "Venue";

    worksheet.getCell("B8").alignment = {
      vertical: "middle",
      horizontal: "center",
    };

    worksheet.getCell("B8").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    worksheet.getCell("B8").font = {
      size: 14,

      bold: true,
    };

    worksheet.mergeCells("D8:F8");

    worksheet.getCell("D8").value = this.empList[0].Venue;
    worksheet.getCell("D8").alignment = {
      vertical: "middle",
      horizontal: "left",
    };

    worksheet.getCell("D8").border = {
      top: { style: "thick" },
      left: { style: "thick" },
      bottom: { style: "thick" },
      right: { style: "thick" },
    };

    worksheet.getCell("D8").font = {
      size: 14,
    };

    worksheet.getRows(9, 1).forEach((row) => {
      for (let i = 2; i <= 6; i++) {
        row.getCell(i).value = exportExcelColumns[i - 2];
        row.alignment = {
          vertical: "middle",
          horizontal: "center",
        };
        row.font = {
          size: 10,
          bold: true,
        };
        row.getCell(i).fill = {
          type: "pattern",
          pattern: "lightGray",
        };
        row.getCell(i).border = {
          top: { style: "thick" },
          left: { style: "thick" },
          bottom: { style: "thick" },
          right: { style: "thick" },
        };
      }
    });
    worksheet.columns = [
      { width: 10 },
      { width: 10 },
      { width: 30 },
      { width: 50 },
      { width: 30 },
      { width: 30 },
    ];

    this.empList.map((data, index) => {
      const rowValues = [];
      rowValues[2] = index + 1;

      rowValues[3] = data.employeenumber;
      rowValues[4] = data.nameofemployee;
      rowValues[5] = data.Deartmentname;
      rowValues[6] = data.signature;

      worksheet.addRow(rowValues, "n");
    });

    worksheet.getRows(10, this.empList.length).forEach((row) => {
      for (let i = 2; i <= 6; i++) {
        row.alignment = {
          vertical: "middle",
          horizontal: "center",
        };
        row.font = {
          size: 10,
          bold: false,
        };
        row.getCell(i).border = {
          top: { style: "thick" },
          left: { style: "thick" },
          bottom: { style: "thick" },
          right: { style: "thick" },
        };
      }
      row.height = 55;
    });
    workbook.xlsx.writeBuffer().then((data) => {
      let blob = new Blob([data], {
        type:
          "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet",
      });
      fs.saveAs(blob, "TrainingAttendance" + "_export_" + new Date().getTime());
    });
  }
}
